import './Home.css';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <>
      <div>
       <Link to="/"><p>lulu school</p></Link>
       <div>
        <ul class="navbar-nav me-auto mb-2 mb-lg-0">
         
          <li class="nav-item">
            <button class="nav-link">Features</button>
          </li>

          <li class="nav-item">
            <button class="nav-link">Pricing</button>
          </li>
          
        </ul>
      </div>
    </div> 
    </>
  );
}

export default Home;
